import React from 'react'
import { Card } from 'react-bootstrap'
function Product() {
    return (
        <Card className='my-3 rounded'>
            <a href={`/product/${product._id}`}> 
                <Card.Img src={product.image}/>
            </a>
        </Card>
    )
}

export default Product
